    state = {
        selectedOption: null,
    };

    render() {
        const { selectedOption } = this.state;
        const options = new F1InfoAPI().Drivers("f1/info/drivers").then((result) => {return result})
        console.log("Options", options)
        return (
            <Select
                value={selectedOption}
                //onChange={this.handleChange}
               // options={options}
            />
        );
    }
}

